import { useNavigate } from "react-router-dom";
import { RiCheckboxCircleLine } from "react-icons/ri";

export default function KYCStep5() {
  const navigate = useNavigate();

  const handleFinish = () => {
    navigate("/"); // Redirect to home/dashboard
  };

  return (
    <div className="h-full w-full flex justify-center items-center">
      <div className="w-full max-w-md bg-white p-8 rounded-xl shadow-lg border border-gray-200 text-center">
        <RiCheckboxCircleLine className="text-green-500 text-6xl mx-auto mb-4" />
        <h1 className="text-3xl font-bold mb-4 text-gray-800">KYC Completed</h1>
        <p className="mb-6 text-gray-600">Thank you for completing your KYC process. Your documents are under verification.</p>
        <button
          onClick={handleFinish}
          className="w-full bg-blue-700 hover:bg-blue-800 text-white font-semibold py-3 rounded-lg transition duration-200"
        >
          Finish
        </button>
      </div>
    </div>
  );
}
